query:
/*+ NoHashJoin(l o d) */ select sum(l.l_extendedprice * l.l_discount) AS revenue
from lineitem AS l
inner join orders AS o
on l.l_orderkey = o.o_orderkey AND l.l_discount BETWEEN 4 AND 6 AND l.l_quantity BETWEEN 26 AND 35
inner join date AS d
on o.o_orderdate = d.d_datekey AND d.d_yearmonthnum = 199401;
